  return (
    <div className="App">
      <h1>Weather App</h1>
      <Card>
        <InputGroup>
           <FormControl
          placeholder="Username"
          aria-label="Username"
          aria-describedby="basic-addon1"
            />
        </InputGroup>
      </Card>

    </div>
  );
}

export default App;
